import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route } from "react-router-dom";
import './App.css';
import Home from './Pages/Home';

function App() {
  return (
    <Router>
      <Route path="/" Component={<Home />}/>
    </Router>
  );
}

export default App;
